  private montarGrafico(): Promise<void> {
    return new Promise((resolve) => {
      const ctx = this.graficoCanvas.nativeElement.getContext('2d');
      if (!ctx) return resolve();

      if (this.chart) {
        this.chart.destroy();
      }

      const labels = this.dadosTabela.map(d => d.tempo);
      const valores = this.dadosTabela.map(d => d.valor);

      this.chart = new Chart(ctx, {
        type: 'line',
        data: {
          labels: labels,
          datasets: [{
            data: valores,
            borderColor: 'blue',
            fill: false,
            pointRadius: 3
          }]
        },
        options: {
          responsive: false,
          animation: {
            onComplete: () => {
              resolve(); // üîπ s√≥ libera quando o gr√°fico terminou de renderizar
            }
          },
          plugins: { legend: { display: false } },
          scales: { y: { beginAtZero: true } }
        }
      });
    });
  }

